// frontend/src/components/Dashboard/Submissions/SubmissionList.js
import React from 'react';

const SubmissionList = ({
  submissions,
  onViewSubmission,
  onEditSubmission,
  onCreateSubmission,
  onDeleteSubmission,
  filter,
  onFilterChange
}) => {
  const getStatusBadgeClass = (status) => {
    switch (status) {
      case 'draft': return 'status-badge status-draft';
      case 'submitted': return 'status-badge status-submitted';
      case 'approved': return 'status-badge status-approved';
      case 'rejected': return 'status-badge status-rejected';
      default: return 'status-badge status-draft';
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'Not submitted';
    return new Date(dateString).toLocaleDateString();
  };

  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD'
    }).format(amount);
  };

  return (
    <div className="submissions-list">
      <div className="submissions-header">
        <h1>Grant Submissions</h1>
        <button 
          className="btn-create"
          onClick={onCreateSubmission}
        >
          <i className="fas fa-plus"></i>
          New Submission
        </button>
      </div>

      <div className="submissions-filter">
        <span className="filter-label">Filter by Status:</span>
        <select 
          className="filter-select"
          value={filter} 
          onChange={(e) => onFilterChange(e.target.value)}
        >
          <option value="all">All Submissions</option>
          <option value="draft">Draft</option>
          <option value="submitted">Submitted</option>
          <option value="approved">Approved</option>
          <option value="rejected">Rejected</option>
        </select>
      </div>

      <div className="table-container">
        <table className="submissions-table">
          <thead>
            <tr>
              <th>Grant Title</th>
              <th>Client</th>
              <th>Funder</th>
              <th>Amount</th>
              <th>Submitted Date</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {submissions.length === 0 ? (
              <tr>
                <td colSpan="7" style={{ textAlign: 'center', padding: '40px' }}>
                  No submissions found. Create your first submission!
                </td>
              </tr>
            ) : (
              submissions.map(submission => (
                <tr key={submission.id}>
                  <td>
                    <strong 
                      className="grant-title-link"
                      onClick={() => onViewSubmission(submission)}
                      style={{ cursor: 'pointer', color: '#007bff' }}
                    >
                      {submission.grantTitle}
                    </strong>
                  </td>
                  <td>{submission.clientName}</td>
                  <td>{submission.funder}</td>
                  <td>{formatCurrency(submission.amount)}</td>
                  <td>{formatDate(submission.submittedDate)}</td>
                  <td>
                    <span className={getStatusBadgeClass(submission.status)}>
                      {submission.status}
                    </span>
                  </td>
                  <td>
                    <button 
                      className="btn-edit"
                      onClick={() => onEditSubmission(submission)}
                    >
                      <i className="fas fa-edit"></i>
                    </button>
                    <button 
                      className="btn-delete"
                      onClick={() => onDeleteSubmission(submission.id)}
                    >
                      <i className="fas fa-trash"></i>
                    </button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default SubmissionList;
